using namespace std;
using ll = long long;

int main(int argc, char **argv)
{
	ll X, Y, A, B, C; cin >> X >> Y >> A >> B >> C;
	priority_queue<ll> a, b, c;
	for (ll i = 0; i < A; ++i) {ll tmp; cin >> tmp; a.push(tmp);}
	for (ll i = 0; i < B; ++i) {ll tmp; cin >> tmp; b.push(tmp);}
	for (ll i = 0; i < C; ++i) {ll tmp; cin >> tmp; c.push(tmp);}

	ll res{0};
	for (ll i = 0; i < X-C; ++i)
	{
		res += a.top();
		a.pop();
	}
	for (ll i = 0; i < Y-C; ++i)
	{
		res += b.top();
		a.pop();
	}

	while ((int)a.size() != X-C || (int)b.size() != Y-C)
	{
		ll aa{0}, bb{0}, cc{0};
		if (!a.empty()) aa = a.top();
		if (!b.empty()) bb = b.top();
		if (!c.empty()) cc = c.top();

		if (cc >= bb && cc >= aa)
		{
			res += cc;
			c.pop();
			
		}
		else if (bb >= cc && bb >= aa)
		{
			res += bb;
			b.pop();
		}
		else if (aa >= bb && aa >= cc)
		{
			res += aa;
			a.pop();
		}
	}

	std::cout << res << std::endl;
}
